import React, {useState} from 'react';
import axios from 'axios';

export default function Prueba() {
    const [user, setUser] = useState("");
    const [password, setPassword] = useState("")


    const prueba = async function handleSubmit(e){
        e.prevent.default()
        await axios.get("/prueba",
            console.log(prueba)
        )
    }


        return (
            <div>
             <form onSubmit={prueba}>
                 <h1><label>User:</label></h1>
                 <input type="name" name="user" placeholder="User" value={user} onChange={(e)=>{setUser(e.target.value)}}/>
                 <br/>
                 <br/>
                <h1><label>Password:</label></h1> 
                <input
                type="password"
                name="password" placeholder='Password' value={password} onChange={(e)=>{setPassword(e.target.value)
                }}/>

             </form>
            </div>
        )
    }
